predict_class = str(client.recv(1024), encoding='utf-8')
had_error = re.search(r"Error : (.+)",predict_class)

if had_error:
    raise Exception(had_error.group(1))
else:
    print(predict_class)
client.close()

print(datetime.datetime.now() - s)